var warningImageLink = "/Thingworx/MediaEntities/PTC.Nav.WarningMediaEntity";

var topPathId = bomIT[0].Id;
bomIT[0].Quantity = 1.0;

function calcCost(bomIT, assyPathId){

    // bomITの中で集計対象assyのデータを見つける
    var assyIndex = 0;
    var assyData = null;
    for(var i=0; i<bomIT.length; i++){
        var rowData = bomIT[i];
        var rowPathId = rowData.Id;
        // 一致で見つける
        if(rowPathId === assyPathId){
            assyIndex = i;
            assyData = rowData;
            //break;
        }
        // 末端部品でコスト値が無い場合は警告アイコンを表示
        if(rowData.Cost==undefined && !rowData.HasChildren){
            rowData.CostRolledUpStatus = warningImageLink;
        }
    }
   
    // assyを親にもつ子partのみの INFOTABLEデータ subbomIT をつくる
    // （partの親 Idが assyと一致するデータを EQFilterで抽出） 
    var subbomIT = Resources["InfoTableFunctions"].EQFilter({
        fieldName: "ParentId" ,
        t: bomIT ,
        value: assyPathId 
    });
       
    var rollUpCost = 0.0;
    var rollUpAll = true; // コスト値がない部品がある場合は false
    for(var j=0; j<subbomIT.length; j++){
        var partData = subbomIT[j];
        if(partData.HasChildren){
            // 子部品に、さらに子部品がある場合
            var partCost = partData.CostRolledUp;
            //if(partCost == null){
            if(partCost == undefined){
                // コスト未集計の場合は、集計処理を実施する
                partCost = calcCost(bomIT, partData.Id);
                rollUpAll = false;
            }
            //else{
                // コスト集計済の場合は、集計値をコスト値として加算する
                rollUpCost = rollUpCost + partCost * partData.Quantity;
            //}
        }
        else{
            // 子部品に、さらに子部品はない場合
            var partCostQty = partData.CostQty;
            if(partCostQty != undefined){
                // コスト値があれば、部品コスト×数量を加算する
                rollUpCost = rollUpCost + partCostQty;
            }
            else{
                rollUpAll = false;
            }
        }
    }
    bomIT[assyIndex].CostRolledUp = rollUpCost;
    bomIT[assyIndex].CostQty = rollUpCost * bomIT[assyIndex].Quantity;
    //bomIT[assyIndex].CostRolledUpQty = rollUpCost * bomIT[assyIndex].Quantity;
    if(!rollUpAll){
        // 集計対象にコスト値無しがあった場合は警告アイコンを表示
    	bomIT[assyIndex].CostRolledUpStatus = warningImageLink;
    }
    return rollUpCost;
/*    
    currentRowData.rolledUpCost = rollUpCost * currentRowData.quantityAmount;
*/    
}

